const Home = () => {
return (
	<div>
		<h1>NFT</h1><br/>

		<div className="card col-sm-6 bg-secondary">
			<div class="card-body">
				<div class="card-header">
					<h5 class="card-title">Faucet NFT Token: </h5>
				</div>
				<form>Address:
					<input type="text" className="form-control" placeholder=""/>
					<button type="submit" className="btn btn-primary">submit</button>
				</form>
			</div>
		</div>

		<div className="card col-sm-6 bg-secondary">
			<div class="card-body">
				<div class="card-header">
					<h5 class="card-title">Add artist to NFT</h5>
				</div>
					<form>Address:
						<input type="text" className="form-control" placeholder=""/>
						<button type="submit" className="btn btn-primary">submit</button>
					</form>
			</div>
		</div>

	</div>

);
};

export default Home;
